import React from 'react';
import Button from '@material-ui/core/Button';
import AddIcon from '@material-ui/icons/Add';


const CreateNote = (props) => {

    return (
        // <form onChange={props.prevfunc}>
        <form>
            <br></br>
            <input type='text'  name ={props.titl} placeholder='Title' onChange={props.inputfunc} />
            <br></br>
            <input type='text' name = {props.contnt} placeholder='Write a note..' onChange={props.inputfunc} />
            <Button color="secondary" onClick = {props.addfunc}><AddIcon /></Button>
        </form>
    );
}

export default CreateNote;
